import {View} from 'react-native';
import MapView from 'react-native-maps';



export default function TripScreen(){
    return (

        <View>
              <MapView
    initialRegion={{
      latitude: 37.78825,
      longitude: -122.4324,
      latitudeDelta: 0.0922,
      longitudeDelta: 0.0421,
    }}
  />  
        </View>
    );
}
const styles =({
    imageContainer: {
        width:300,
        height:50,
        alignItems: 'center'
    },
    container: {
        flex: 1,
      },
      image: {
        flex: 1,
        justifyContent: "center"
      },
      text: {
        color: "black",
        fontSize: 40,
        lineHeight: 84,
        fontWeight: "bold",
        textAlign: "center",
        backgroundColor: "#000000c0"
      },
      containerViewHome:{
        position:'absolute',
        top:0,
        bottom:0,
        left:0,
        right:0
      },
      animatedView:{
        flex:1,
        alignItems:'center',
        justifyContent:'center'
      },
      logoContainer:{
        width: '100%',
        height: '100%'
      }
  });
